import React from "react";
import { Redirect, Route, useRouteMatch } from "react-router";
import useAuth from "../auth/useAuth";

const PrivateRoute = (props) => {
  const { user } = useAuth();

  if (!user?.email) return <Redirect to="/login" />;

  return <Route {...props} />;
};

export default PrivateRoute;
